    userValue = event.target.value;
    console.log(userValue);
}

const sub = (event)=>{
    axios.get({
        method: 'get',
        url: 'https://vpic.nhtsa.dot.gov/api/vehicles/DecodeVin/5UXWX7C5*BA?format=xml&modelyear=2011'
      })
      .then(res=> {data = (JSON.stringify(res, '', 2))})
